        background-color: #fff;
        /*border-top: 1px solid #ccc;*/

    }

    /*table.sportorg-table tr:nth-child(2n) {*/
        /*background-color: #f8f8f8;*/

    table.empty-table {
        width: auto;
    }

        background-color: white;
        border: 0;
    }

    table.empty-table td, table.empty-table th {
        border: 0;
    }

        box-sizing: content-box;
        height: 0;
    }

        margin: 15px 0;
        overflow: hidden;
        background: transparent;
        border: 0;
        border-bottom: 1px solid #ddd;
    }

        display: table;
        content: "";
    }

        display: table;
        clear: both;
        content: "";
    }

        height: 4px;
        padding: 0;
        margin: 16px 0;
        background-color: #e7e7e7;
        border: 0 none;
    }

    a:not([href]) {
        color: inherit;
        text-decoration: none;
    }

    a {
        color: #4078c0;
        text-decoration: none;
    }

    a:hover,
    a:active {
        text-decoration: underline;
    }

    a {
        background-color: transparent;
    }

    a:active,
    a:hover {
        outline: 0;
    }

    .print-only {
        display: none;
    }

    .no-print {
        display: block;
    }

    .nowrap {
        white-space: nowrap;
    }

    .text-center {
        text-align: center;
    }

    /* SPLITS */

    .table-leg {
        padding: 0;
        margin: 0;
    }

    .table-leg th,
    .table-leg td {
        border: 0;
    }

    .table-leg tr {
        border-top: 0;
    }

    .result-1,
    .result-2,
    .result-3 {
        font-weight: bold;
    }

    .result-1 {
        /*background: gold;*/
    }

    .result-2 {
        /*background: silver;*/
    }

    .result-3 {
        /*background: #cd7f32;*/
    }

    @media print {
        @page {
            margin: 0.5cm;
        }

        body {
            font-size: 85%;
        }

        table.sportorg-table {
            display: table;
            width: 100%;
        }

        table.sportorg-table th,
        table.sportorg-table td {
            padding: 1px 10px;
        }

        table.sportorg-table,
        pre {
            margin-bottom: 1px;
        }


        h1,
        h2,
        h3,
        h4,
        h5,
        h6 {
            margin: 1px 0;
        }

        section, .new-page {
            page-break-before: always;
        }

        ul {
            page-break-inside: avoid;
        }

        p {
            widows: 4;
        }

        a[href^="http"]:after {
            content: " (" attr(href) ")";
        }

        abbr[title]:after {
            content: " (" attr(title) ")";
        }

        .print-only {
            display: inline;
        }

        .no-print {
            display: none;
        }
    }
</style>

        value %= 3600;
        var minutes = Math.floor(value / 60);

            return (dd < 10 ? '0' + dd : dd) + '';
        };

            this.pageScroll();
            return this;
        },
        pageScroll: function () {
            var _this = this;
            if (_this.enabled && ! _this.lock) {
                window.scrollBy(10, _this.direction);
            }
            setTimeout(function () {
                _this.pageScroll();
            }, 10);
        }
    }.init();

    new SettingsGenerator([
        {
            title: 'Табличный вид',
            value: !!store.tableView,
            change: function (checked) {
                store.tableView = checked;
                render()
            }
        },
        {
            title: 'Номер',
            value: Fields.isActive('bib'),
            change: function (checked) {
                Fields.active('bib', checked);
                render()
            }
        },
        {
            title: 'Номер чипа',
            value: Fields.isActive('card_number'),
            change: function (checked) {
                Fields.active('card_number', checked);
                render()
            }
        },
        {
            title: 'Автоскролл',
            value: Scrolling.enabled,
            change: function (checked) {
                Scrolling.enabled = checked;
            }
        },
    ]).show();
</script>
